-- ----------------------------
-- Table structure for `mall_activity`
-- ----------------------------
DROP TABLE IF EXISTS `mall_activity`;
CREATE TABLE `mall_activity` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL COMMENT '活动名称',
  `start_time` datetime NOT NULL COMMENT '活动开始时间',
  `end_time` datetime NOT NULL COMMENT '活动结束时间',
  `activity_status` tinyint(4) NOT NULL COMMENT '活动状态, 1:待审核，2:待发布(审核成功)，3:已发布',
  `status` tinyint(4) NOT NULL COMMENT '1:正常，2:弃用，3:删除',
  `create_time` datetime NOT NULL,
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of mall_activity
-- ----------------------------

-- ----------------------------
-- Table structure for `mall_activity_product_ref`
-- ----------------------------
DROP TABLE IF EXISTS `mall_activity_product_ref`;
CREATE TABLE `mall_activity_product_ref` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `activity_id` int(11) NOT NULL COMMENT '活动id',
  `product_id` int(11) NOT NULL COMMENT '商品id',
  `stock` int(11) NOT NULL COMMENT '秒杀库存',
  `seckill_price` decimal(10,0) NOT NULL DEFAULT '1' COMMENT '秒杀价格，默认一元',
  `price` decimal(20,2) NOT NULL COMMENT '原价格',
  `status` tinyint(4) NOT NULL COMMENT '状态',
  `create_time` datetime NOT NULL,
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8;

