-- ----------------------------
-- Table structure for `mall_cart`
-- ----------------------------
DROP TABLE IF EXISTS `mall_cart`;
CREATE TABLE `mall_cart` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '购物车主键id',
  `user_id` int(11) NOT NULL COMMENT '用户id,对应mall_user表的主键id',
  `product_id` int(11) NOT NULL COMMENT '商品id,对应表mall_product的主键id',
  `quantity` int(11) NOT NULL DEFAULT '0' COMMENT '数量',
  `checked` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否选中：1-勾选，0-未勾选',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态：1-启用，2-弃用',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `user_id_index` (`user_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

