-- Records of mall_cart
-- ----------------------------

-- ----------------------------
-- Table structure for `mall_category`
-- ----------------------------
DROP TABLE IF EXISTS `mall_category`;
CREATE TABLE `mall_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `parent_id` int(11) DEFAULT '0' COMMENT '父类id：0-根节点，非0不是根节点',
  `name` varchar(50) NOT NULL COMMENT '目录名称',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态: 1-启用，1-废弃',
  `sort_order` int(11) DEFAULT '0' COMMENT '排序值',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8;

