-- ----------------------------
-- Table structure for `mall_order`
-- ----------------------------
DROP TABLE IF EXISTS `mall_order`;
CREATE TABLE `mall_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `order_no` varchar(20) NOT NULL COMMENT '订单号',
  `user_id` int(11) NOT NULL COMMENT '用户id,对应表mall_user的主键Id',
  `shipping_id` int(11) NOT NULL COMMENT '送货地址，对应表mall_shipping的主键id',
  `payment` decimal(20,2) NOT NULL COMMENT '实际付款金额，单位元，保留两位小树',
  `payment_type` varchar(10) DEFAULT NULL,
  `postage` int(11) DEFAULT NULL COMMENT '运费，单位元 ',
  `order_status` tinyint(4) NOT NULL COMMENT '订单状态：0-已取消，10-未付款，20-已付款，30-已发货，40-交易成功，50-交易关闭',
  `payment_time` datetime DEFAULT NULL COMMENT '支付时间',
  `send_time` datetime DEFAULT NULL COMMENT '发货时间',
  `end_time` datetime DEFAULT NULL COMMENT '交易完成时间',
  `close_time` datetime DEFAULT NULL COMMENT '交易关闭时间',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态：1-启用，2-弃用',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_no_unique_key` (`order_no`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of mall_order
-- ----------------------------

-- ----------------------------
-- Table structure for `mall_order_item`
-- ----------------------------
DROP TABLE IF EXISTS `mall_order_item`;
CREATE TABLE `mall_order_item` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `user_id` int(11) NOT NULL COMMENT '用户id,对应表mall_user的主键id',
  `order_id` bigint(20) NOT NULL COMMENT '订单id',
  `product_id` int(11) NOT NULL COMMENT '商品id,对应表mall_product的id',
  `product_name` varchar(100) NOT NULL COMMENT '商品名称',
  `product_image` varchar(500) NOT NULL COMMENT '商品图片',
  `current_unit_price` decimal(20,2) NOT NULL COMMENT '生成订单时的商品单价，单位元，保留两位小数',
  `quantity` int(11) NOT NULL COMMENT '数量',
  `total_price` decimal(20,2) NOT NULL COMMENT '商品总价，单位元，保留两位小数',
  `status` tinyint(4) NOT NULL COMMENT '状态：1-启用，2-弃用',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `order_no_index` (`order_id`),
  KEY `order_no_user_id_index` (`user_id`,`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=44 DEFAULT CHARSET=utf8;

