-- ----------------------------
-- Table structure for `mall_product`
-- ----------------------------
DROP TABLE IF EXISTS `mall_product`;
CREATE TABLE `mall_product` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键商品id',
  `category_id` int(11) NOT NULL COMMENT '分类id,对应mall_category表的主键',
  `name` varchar(100) NOT NULL COMMENT '商品名称',
  `sub_title` varchar(200) DEFAULT NULL COMMENT '副标题',
  `detail` text COMMENT '商品详情',
  `seckill_price` decimal(10,0) NOT NULL DEFAULT '1' COMMENT '秒杀价格，默认一元',
  `price` decimal(20,2) NOT NULL COMMENT '商品原价格',
  `stock` int(11) NOT NULL COMMENT '商品库存数量',
  `product_status` tinyint(6) NOT NULL DEFAULT '1' COMMENT '商品状态：1-待售，2-上架，3-缺货，4-下架',
  `image_id` int(11) DEFAULT NULL COMMENT '与图片表关联的关系',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '数据状态：1-启用，2-弃用',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

