-- ----------------------------
-- Table structure for `mall_shipping`
-- ----------------------------
DROP TABLE IF EXISTS `mall_shipping`;
CREATE TABLE `mall_shipping` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `user_id` int(11) NOT NULL COMMENT '用户id,对应表mall_user的id',
  `receiver_name` varchar(20) NOT NULL COMMENT '收货人',
  `receiver_phone` varchar(20) DEFAULT NULL COMMENT '收货人电话',
  `receiver_mobile` varchar(20) NOT NULL COMMENT '收货人移动电话',
  `receiver_province` varchar(20) NOT NULL COMMENT '收获省份',
  `receiver_city` varchar(20) NOT NULL COMMENT '收获城市',
  `receiver_district` varchar(20) NOT NULL COMMENT '收获地址的区/县',
  `receiver_address` varchar(200) NOT NULL COMMENT '收获详细地址',
  `receiver_zip` varchar(6) NOT NULL COMMENT '收获地址的邮编',
  `status` tinyint(4) NOT NULL COMMENT '状态：1-启用，2-弃用',
