-- ----------------------------
-- Table structure for `mall_user`
-- ----------------------------
DROP TABLE IF EXISTS `mall_user`;
CREATE TABLE `mall_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `name` varchar(100) NOT NULL COMMENT '用户名',
  `password` varchar(100) NOT NULL COMMENT '密码，MD5加密',
  `email` varchar(100) DEFAULT NULL COMMENT '邮箱',
  `mobile` varchar(20) DEFAULT NULL COMMENT '手机号',
  `question` varchar(200) DEFAULT NULL COMMENT '找回密码的问题',
  `answer` varchar(200) DEFAULT NULL COMMENT '找回密码的答案',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态：1-启用，2-禁用，3-被删除的',
  `role` tinyint(1) NOT NULL COMMENT '角色: 0-超级管理员 1-普通管理员 2-普通用户',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_name_unique_key` (`name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=10031 DEFAULT CHARSET=utf8;

